import React from 'react'

import WeaterExtraInfo from './WeatherExtraInfo'
import WeatherTemperature from './WeatherTemperature'

const WeatherData = () => (
    <div>
        <WeatherTemperature 
            temperature={20} 
            weatherState={'sunny'}
        />
        <WeaterExtraInfo 
            humidity={80} 
            wind={10}
        />
    </div>

)
export default WeatherData
